import React from "react";

import { Col,Form, FormGroup} from "reactstrap";
//import SearchBar from "../Shared/SearchBar";
//import { Container } from "reactstrap";

const Home = () => {
    return(<Col lg='12'>
    <div className="search__bar">
    <Form className="d-flex align-items-center gap-4">
        <FormGroup className="d-flex gap-3 form__group form__group-fast">
            <span>
            <i class="ri-map-pin-line"></i> </span>
            <div>
                <h1>Destination</h1>
                <input type="Text" placeholder="Where are you going"/>
            </div>
        </FormGroup>
        <FormGroup className="d-flex gap-3 form__group form__group-fast">
            <span>
            <i class="ri-map-pin-time-line"></i></span>   
     <div>
                <h1>Distance</h1>
                <input type="number" placeholder="Distance k/m"/>
            </div>
        </FormGroup>
        <FormGroup className="d-flex gap-3 form__group form__group-last">
            <span>
            <i class="ri-group-line"></i> </span>
            <div>
                <h1>No of Travalers</h1>
                <input type="number" placeholder="number of Travalers"/>
            </div>
        </FormGroup>
    </Form>
    </div>
    </Col>
    ) ;
};

export default Home;
